import React from 'react';

class App extends React.Component {
  constructor() {
    super()
    this.state = {
      todo: {}
    }
  }

  componentDidMount() {
    fetch("https://jsonplaceholder.typicode.com/todos")
        .then(response => response.json())
        .then(data => {
            this.setState({
              todo: data
            })
            console.log(this.state.todo.title)
        })
  }

  render() {
    return (
      <div>
        {this.state.todo.title}
      </div>
    )
  }

}

export default App;
